            <p>Your Health Needs at your reach</p>  
            </div>
<div className={css.search}>
<form >
  <input type="search" id="search" name="search" placeholder="Search Products & Services" />
  <button>search</button>
</form>

</div>

            <div className={css.cart}>
              <div> <img src="/user.png" /><Link href="">Login/Signup</Link> </div>               
                <div><Link><img src="/cart.png"/></Link>  Cart</div>
                </div>
            
        </header>
    )
}

